Defendant Roderick D Whitmore in court with attorney Richard E. Thomey.  Defendant Roderick D Whitmore in custody.  Kimberly D. Schoepp appeared for the State of Wisconsin.  Pursuant to negotiations, the State moved to dismiss but read in Counts 2 and 3.  Court granted State's motion and ordered Counts 2 and 3 dismissed but read in.

AS TO COUNT 01:
 Defendant was advised of constitutional rights and maximum penalties, and further advised that if not a United States citizen deportation is possible. Defendant sworn, examined as to plea, and entered a plea of guilty.  Court found defendant freely, voluntarily and intelligently waived all constitutional rights. Plea questionnaire waiver of rights and addendum to plea questionnaire received and filed. Parties stipulated to the criminal complaint as factual basis to sustain defendant's plea. Court found defendant guilty as charged in the Information and ordered a Judgment of Conviction be entered into the record.   

Sentencing proceeded.  Statements by the State, defense and defendant.  
The court imposed 6 months at the House of Correction, concurrent to sentence in 13CF3098.  The Court STAYED THE SENTENCE and placed the defendant on probation to the State Department of Corrections for a period of one year, concurrent to 13CF3098.

CONDITIONS OF PROBATION:
 - No controlled substances or alcohol;
 - AODA assessment and treatment;
 - Urine screens;
 - No contact with Alphonso C. or his residence;
 - No contact with the Target store located at 2600 South 108th Street, city of West Allis, Milwaukee County, Wisconsin;
 - Obtain GED;
 - Seek and maintain employment;
 - Job and vocational training;
 - Parenting classes/counseling;
 - Anger management counseling;
 - Cognitive thinking intervention counseling;
  - Pay the costs, surcharges and disbursements. Failure to pay would result in a civil judgment entered against defendant, which is non-dischargable in bankruptcy;
 - Serve 90 days condition time at the House of Correction, with Huber for work; good time allowed.

Court set restitution at zero, but reserved its right within the statutory time period of 60 days should the victim come forward and request restitution.

